import React, { PropTypes, Component } from 'react';
import AntPromt from 'components/UI/Promt';
import { Card as AntCard } from 'antd';
import { Entity } from 'draft-js';
import { isEqual } from 'lodash';
import ReactCrop from 'react-image-crop/dist/ReactCrop';
import 'react-image-crop/dist/ReactCrop.css';

import styles from './styles.css';

class Img extends Component {

  constructor(props) {
    super(props);
    this.state = {
      ...props.content,
      promt: {
        open: false,
        value: null,
      },
    };
  }

  shouldComponentUpdate(
    nextProps,
    nextState
  ) {
    return !isEqual(
      this.state,
      nextState
    );
  }

  onCropComplete = (crop, pixelCrop) => {
    console.log(crop);
    console.log(pixelCrop);
    this.setState({
      crop: pixelCrop,
      position: {
        top: `-${pixelCrop.y}px`,
        left: `-${pixelCrop.x}px`,
      },
      clip: crop.width && crop.height ? {
        clipPath:
          `inset(${
              crop.y
            }% ${
              100 - crop.x - crop.width
            }% ${
              100 - crop.y - crop.height
            }% ${
              crop.x
            }%)`,
      } : {},
    });
  }

  modifyContent = () => {
    const {
      value: source,
    } = this.state.promt;
    Entity.replaceData(
      this.props.entityKey, {
        content: {
          source,
          text: this
            .state
            .text,
        },
      }
    );
    this.setState({
      source,
      promt: {
        open: false,
      },
    });
  }

  editContent = () => {
    this.setState({
      promt: {
        open: true,
        value: this
          .state
          .source,
      },
    });
  }

  render() {
    const {
      text,
      source,
      promt,
    } = this.state;
    return (
      <div>
        <AntCard
          className={styles.card}
          bodyStyle={{ padding: 0 }}
          onDoubleClick={this.editContent}
        >
          <div className={styles.text}>
            <p>{text}</p>
            <ReactCrop
              src={source}
              onComplete={this.onCropComplete}
            />
          </div>
          <div style={this.state.crop} className={styles.container} >
            <img className={styles.preview} src={source} style={this.state.position} alt="" />
          </div>
        </AntCard>
        <AntPromt
          type="textarea"
          value={promt.value}
          onSave={this.modifyContent}
          visible={promt.open}
          onChange={(event) => {
            this.setState({
              promt: {
                ...promt,
                value: event
                  .target
                  .value,
              },
            });
          }}
          onCancel={() => {
            this.setState({
              promt: {
                ...promt,
                open: false,
              },
            });
          }}
        />
      </div>
    );
  }
}

Img.propTypes = {
  entityKey: PropTypes.string.isRequired,
  content: PropTypes.shape({
    text: PropTypes.string.isRequired,
    source: PropTypes.string.isRequired,
  }).isRequired,
};

Img.defaultProps = {
  content: {
    text: 'Изображение',
    source: 'data:image/jpeg;base64,',
  },
};

export default Img;
